import React, { Component } from "react";
import {RecommendWrapper, RecommendItem} from "../st" 

class Recommend extends Component {
  render() {
    return (
      <RecommendWrapper>
        <RecommendItem></RecommendItem>
        <RecommendItem></RecommendItem>
      </RecommendWrapper>
    );
  }
}

export default Recommend;
